import React from 'react';
import { Button, StyleSheet } from 'react-native';
import { LinearGradient } from "expo-linear-gradient";
import * as DocumentPicker from 'expo-document-picker';
import { Container, Text } from '../../component'

const Home = ({ navigation }) => {
    return (
        <Container row justifyCenter wrap paddingY={1}>
            <Container style={styles.menuItem}>
                <Text.TitleH3>PDV</Text.TitleH3>
            </Container>
            <Container style={styles.menuItem}>
                <Text.TitleH3>Reposicion</Text.TitleH3>
            </Container>
            <Container style={styles.menuItem}>
                <Text.TitleH3>Perfil</Text.TitleH3>
            </Container>
        </Container>
    );
}

const styles = StyleSheet.create({
    menuItem: {
        width: 128,
        height: 128,
        borderColor: 'gold',
        borderWidth: 1,
        borderRadius: 16,
        margin: 12,
        justifyContent: 'center',
        alignItems: 'center'
    }
});

export default Home
